    fun findBT() {
        try {
            mBluetoothAdapter = BluetoothAdapter.getDefaultAdapter()
            if (mBluetoothAdapter == null) {
                myLabel!!.text = "No bluetooth adapter available"
            }
            if (!mBluetoothAdapter.isEnabled()) {
                val enableBluetooth = Intent(BluetoothAdapter.ACTION_REQUEST_ENABLE)
                startActivityForResult(enableBluetooth, 0)
            }
            val pairedDevices = mBluetoothAdapter.getBondedDevices()
            if (pairedDevices.size > 0) {
                for (device in pairedDevices) {

                    //TODO CREAR LISTA SELECCIONABLE PARA MARCAR CUAL ES LA IMPRESORA YA QUE EL TELEFONO PUEDE ESTAR VINVULADO CON MAS DE UN DISPOSITIVO BT

                    // we got this name from the list of paired devices
                    if (device.name == "ZQ630-DEV") {
                        mmDevice = device
                        break
                    }
                }
            }
            myLabel!!.text = "Bluetooth device found."
        } catch (e: java.lang.Exception) {
            e.printStackTrace()
        }
    }

    // tries to open a connection to the bluetooth printer device
    @RequiresApi(Build.VERSION_CODES.KITKAT)
    @Throws(IOException::class)
    fun openBT() {
        try {

            // Standard SerialPortService ID
            val uuid: UUID = UUID.fromString(mmDevice.uuids[0].uuid.toString())
            mmSocket = mmDevice.createRfcommSocketToServiceRecord(uuid)
            mmSocket.connect()
            mmOutputStream = mmSocket.outputStream
            mmInputStream = mmSocket.inputStream
            beginListenForData()
            myLabel!!.text = "Bluetooth Opened: ${mmDevice.name}"
        } catch (e: java.lang.Exception) {
            e.printStackTrace()
        }
    }

    @RequiresApi(Build.VERSION_CODES.KITKAT)
    fun beginListenForData() {
        try {
            val handler = Handler()

            // this is the ASCII code for a newline character
            val delimiter: Byte = 10
            stopWorker = false
            readBufferPosition = 0
            readBuffer = ByteArray(1024)
            workerThread = Thread {
                while (!Thread.currentThread().isInterrupted && !stopWorker) {
                    try {
                        val bytesAvailable = mmInputStream!!.available()
                        if (bytesAvailable > 0) {
                            val packetBytes = ByteArray(bytesAvailable)
                            mmInputStream!!.read(packetBytes)
                            for (i in 0 until bytesAvailable) {
                                val b = packetBytes[i]
                                if (b == delimiter) {
                                    val encodedBytes = ByteArray(readBufferPosition)
                                    System.arraycopy(
                                        readBuffer, 0,
                                        encodedBytes, 0,
                                        encodedBytes.size
                                    )

                                    // specify US-ASCII encoding
                                    val data = String(encodedBytes, StandardCharsets.UTF_8)
                                    readBufferPosition = 0

                                    // tell the user data were sent to bluetooth printer device
                                    handler.post(Runnable { myLabel!!.text = data })
                                } else {
                                    readBuffer[readBufferPosition++] = b
                                }
                            }
                        }
                    } catch (ex: IOException) {
                        stopWorker = true
                    }
                }
            }
            workerThread!!.start()
        } catch (e: java.lang.Exception) {
            e.printStackTrace()
        }
    }

    @Throws(IOException::class)
    fun closeBT() {
        try {
            stopWorker = true
            mmOutputStream!!.close()
            mmInputStream!!.close()
            mmSocket.close()
            myLabel!!.text = "Bluetooth Closed"
        } catch (e: java.lang.Exception) {
            e.printStackTrace()
        }
    }

    private fun sendFile(product: ProductServer?) {

        var connection: Connection? = null
        if (mmDevice.address.isNotEmpty()) {
           connection = BluetoothConnection(mmDevice.address)
        }
        try {
            Toast.makeText(this, "Sending file to printer ...", Toast.LENGTH_SHORT).show()
            if(!connection!!.isConnected){
                connection!!.open()
            }
            val printer = ZebraPrinterFactory.getInstance(connection)
            testSendFile(printer, product)
            connection.close()
        } catch (e: ConnectionException) {
            showErrorDialogOnGuiThread(e.message)
        } catch (e: ZebraPrinterLanguageUnknownException) {
            showErrorDialogOnGuiThread(e.message)
        }
    }

    private fun testSendFile(printer: ZebraPrinter, product: ProductServer?) {
        try {
            val filepath = getFileStreamPath("fleje.LBL")
            getLabelkeiki(printer, "fleje.LBL")
            printer.sendFileContents(filepath.absolutePath)
        } catch (e1: ConnectionException) {
            showErrorDialogOnGuiThread("Error sending file to printer")
        } catch (e: IOException) {
            showErrorDialogOnGuiThread("Error creating file")
        }
    }

