    fun showErrorDialogOnGuiThread(errorMessage: String?) {
        runOnUiThread(Runnable {
            AlertDialog.Builder(this).setMessage(errorMessage).setTitle("Error")
                .setPositiveButton(
                    "OK"
                ) { dialog, id ->
                    dialog.dismiss()
                }.create().show()
        })
    }

